4	5	This dataset has been used for ground truth validation of the snow inspector software (http://apps.hydroshare.org/apps/snow-inspector).\r\nOn two days, May 2 and May 9, 2015, 36 areas in the Yellowstone National Park area were visited. The snow inspector software was used to identify the MODIS satellite pixel boundaries at a 1:10,000 scale . For each location we identified between 1 and 8 pixels and estimated the percentage of snow-covered area on the ground. We selected locations with open ground, partially tree-covered ground, and ice-covered lakes. The total number of ground validation pixels was: 102 pixels on May 2, 2015, and 82 pixels on May 9, 2015 (total 184 pixels). Out of the total 184 pixels, Twenty-eight pixels were inspected both on May 2 and on May 9. The attached csv file has the following fields: Location (name of the location), PIXEL_X and PIXEL_Y (satellite pixel identifier), PIXEL, pixel number at the location, X1.May (satellite snow cover percentage on 1st May 2015), X2.May (satellite snow cover percentage on 2nd May 2015), MillerLo (low -bound estimate of snow cover percentage from ground observation), MillerHi (high estimate of snow cover percentage from ground observation), Landcover (type of land cover), Latitude, Longitude (latitude and longitude are in WGS 1984 in decimal degrees).	62
