118	140	Can your desktop computer crunch the large datasets that are becoming increasingly common in hydrology and across the sciences? Do you have access to, or the know how to, take advantage of advanced high performance computing (HPC) capability? Web based cyberinfrastructure takes work off your desk or laptop computer and onto infrastructure or "cloud" based data and processing servers. This talk will describe the HydroShare collaborative environment and web based services being developed to support the sharing and processing of hydrologic data and models. HydroShare is expanding the data sharing capability of the CUAHSI Hydrologic Information System by broadening the classes of data accommodated to include geospatial data used in hydrology. HydroShare will also include new capability to share models and model components, and will take advantage of emerging social media functionality to enhance information about and collaboration around hydrologic data and models. The HydroShare web interface and social media functions are being developed using the Django web application framework. The integrated Rule-Oriented Data System (iRODS) is being used to manage federated data content. This presentation will introduce the HydroShare functionality developed to date and describe ongoing development of functionality to support collaboration and integration of data and models.	62
