187	237	This data provides an illustration of the height above the nearest stream approach to flood inundation mapping based on the TauDEM vertical distance to stream function.  This example uses a 10 m resolution National Elevation dataset for Onion Creek in Texas.   Height above the nearest stream may be thought of as a relative elevation function which measures for every DEM cell in the landscape the difference in elevation between that cell and the cell to which it flows on the stream channel.  This is like a water depth or stage height function defined using  terrain analysis continuously across the landscape.  This relative elevation function, combined with a depth in each stream reach provide a simplified terrain based approach to flood inundation mapping premised on the following:\r\n\r\n1.  Each reach has a water depth hw, from a hydraulic model such as SPRNT or RAPID.\r\n2.  Each reach has an ID\r\n3.  Each grid cell has the ID of the reach it connects to (catchment grid) and the height above the stream hs\r\n4.  Flood extent is rapidly mapped as \r\nIf(hw(id) > hs(id))\r\n   Inundation depth = hw(id) - hs(id)\r\nElse\r\n   Inundation depth = 0\r\n\r\nThe data here can also be used to compute reach averaged hydraulic properties as follows\r\n1.  For each reach the stream network file gives reach length L.\r\n2.  For a series of water depths using the height above nearest stream intersected with catchment raster the innundation water volume V, surface area As and bed area Ab are obtained.\r\n3.  Reach average properties are then computed as\r\nCross section Area A = V/L\r\nWetted perimeter P = Ab/L\r\nTop width = As/L\r\nHydraulic Radius = A/P\r\n\r\nThis approach is a simplification over finer scale hydraulics, and the inaccuracy due to introduction of this simplification still needs evaluation.  This approach is also dependent on how well the DEM represents the channel and flooded area.  This is expected to improve as we get better LIDAR DEMs and develop better ways to hydrologically condition DEMs that do not involve pit filling.	62
