235	295	Anticipated changes to climate, human population, land use, and urban form will alter the hydrology and availability of water within the water systems on which the worlds population relies.  Understanding the effects of these changes will be paramount in sustainably managing water resources, as well as maintaining associated capacity to provide ecosystem services (e.g., regulating flooding, maintaining instream flow during dry periods, cycling nutrients, and maintaining water quality). It will require better information characterizing both natural and human mediated hydrologic systems and enhanced ability to generate, manage, store, analyze, and share growing volumes of observational data. Over the past several years, a number of hydrology domain cyberinfrastructures have emerged or are currently under development that are focused on providing integrated access to and analysis of data for cross-domain synthesis studies. These include the Consortium of Universities for the Advancement of Hydrologic Science, Inc. (CUAHSI) Hydrologic Information System (HIS), the Critical Zone Observatory Information System (CZOData), HydroShare, the BiG CZ software system, and others. These systems have focused on sharing, integrating, and analyzing hydrologic observations data. This presentation will describe commonalities and differences in the cyberinfrastructure approaches used by these projects and will highlight successes and lessons learned in addressing the challenges of big and complex data. It will also identify new challenges and opportunities for next generation cyberinfrastructure and a next generation of cyber-savvy scientists and engineers as developers and users.	62
262	345	The Hydrologic Modeling System (HEC-HMS) is designed to simulate the complete hydrologic processes of dendritic watershed systems. The software includes many traditional hydrologic analysis procedures such as event infiltration, unit hydrographs, and hydrologic routing. HEC-HMS also includes procedures necessary for continuous simulation including evapo-transpiration, snowmelt, and soil moisture accounting. Advanced capabilities are also provided for gridded runoff simulation using the linear quasi-distributed runoff transform (ModClark). Supplemental analysis tools are provided for model optimization, forecasting streamflow, depth-area reduction, assessing model uncertainty, erosion and sediment transport, and water quality.\r\n\r\nThe software features a completely integrated work environment including a database, data entry utilities, computation engine, and results reporting tools. A graphical user interface allows the user seamless movement between the different parts of the software. Simulation results are stored in HEC-DSS (Data Storage System) and can be used in conjunction with other software for studies of water availability, urban drainage, flow forecasting, future urbanization impact, reservoir spillway design, flood damage reduction, floodplain regulation, and systems operation.	116
